import React from 'react';
import image from './img/Fort.png';
import { Helmet } from "react-helmet";
import Slider from "react-slick";
import Divider from '../image/SwirlDivider.png';

import CatagoriesList from './CatagoriesList.js';

/* import "slick-carousel/slick/slick.css";
import "slick-carousel/slick/slick-theme.css"; */
  (function() {
	let mina ="";
	let Snap ="";
	function init() {
		var speed = 250,

			easing = mina.easeinout;

		[].slice.call ( document.querySelectorAll( '#grid > a' ) ).forEach( function( el ) {
			var s = Snap( el.querySelector( 'svg' ) ), path = s.select( 'path' ),
				pathConfig = {
					from : path.attr( 'd' ),
					to : el.getAttribute( 'data-path-to' )
				};

			el.addEventListener( 'mouseenter', function() {
				path.animate( { 'path' : pathConfig.to }, speed, easing );
			} );

			el.addEventListener( 'mouseleave', function() {
				path.animate( { 'path' : pathConfig.from }, speed, easing );
			} );
		} );
	}

	init();

})();

function Catagories() {
	const settings = {
		className: "center",
		infinite: true,
		centerPadding: "60px",
		slidesToShow: 4,
		focusOnSelect: true,
		slidesToScroll:3,
		swipeToSlide: true,
		// dots: true,


		afterChange: function (index) {
			console.log(
				`Slider Changed to: ${index + 1}, background: #222; color: #bada55`
			);
		}
	};
	
	return (
		<div>

			<Helmet>
				<script src="./assets/js/hovers.js"></script>
				<script src="./assets/js/snap.svg-min.js"></script>
				<link rel="stylesheet" type="text/css" href="./assets/css/slick-theme.css" />
		<link rel="stylesheet" type="text/css" href="./assets/css/slick.css" />
			</Helmet>
			<div class="container">


				<header class="codrops-header" id="Catagory">
					<h1>Catagories</h1>
					<img src={Divider} alt="Caption Divider" style={{ width: '150px', height: '25px', marginLeft: '0px' }} />
				</header>

				<section id="grid" class="grid clearfix">

					<Slider {...settings} >
						
						<a href="/#" data-path-hover="m 180,34.57627 -180,0 L 0,0 180,0 z">
							<figure>
								<img src={image} alt='one' />
								<svg viewBox="0 0 180 320" preserveAspectRatio="none"><path d="M 180,160 0,218 0,0 180,0 z" /></svg>
								<figcaption>
									<h2>Rarebook</h2>
									<p>Lorem Ipsum is simply dummy text of the printing and typesetting industry.</p>
									<button>View</button>
								</figcaption>
							</figure>
						</a>
						<a href="/#" data-path-hover="m 180,34.57627 -180,0 L 0,0 180,0 z">
							<figure>
								<img src={image} alt='one' />
								<svg viewBox="0 0 180 320" preserveAspectRatio="none"><path d="M 180,160 0,218 0,0 180,0 z" /></svg>
								<figcaption>
									<h2>Photo Eassy</h2>
									<p>Lorem Ipsum is simply dummy text of the printing and typesetting industry.</p>
									<button>View</button>
								</figcaption>
							</figure>
						</a>
						<a href="/#" data-path-hover="m 180,34.57627 -180,0 L 0,0 180,0 z">
							<figure>
								<img src={image} alt='three' />
								<svg viewBox="0 0 180 320" preserveAspectRatio="none"><path d="M 180,160 0,218 0,0 180,0 z" /></svg>
								<figcaption>
									<h2>E-Book</h2>
									<p>Lorem Ipsum is simply dummy text of the printing and typesetting industry.</p>
									<button>View</button>
								</figcaption>
							</figure>
						</a>
						<a href="/#" data-path-hover="m 180,34.57627 -180,0 L 0,0 180,0 z">
							<figure>
								<img src={image} alt='five' />
								<svg viewBox="0 0 180 320" preserveAspectRatio="none"><path d="M 180,160 0,218 0,0 180,0 z" /></svg>
								<figcaption>
									<h2>Food and Culture</h2>
									<p>Lorem Ipsum is simply dummy text of the printing and typesetting industry.</p>
									<button>View</button>
								</figcaption>
							</figure>
						</a>
						<a href="/#" data-path-hover="m 180,34.57627 -180,0 L 0,0 180,0 z">
							<figure>
								<img src={image} alt='one' />
								<svg viewBox="0 0 180 320" preserveAspectRatio="none"><path d="M 180,160 0,218 0,0 180,0 z" /></svg>
								<figcaption>
									<h2>Snippets</h2>
									<p>Lorem Ipsum is simply dummy text of the printing and typesetting industry.</p>
									<button>View</button>
								</figcaption>
							</figure>
						</a>
						<a href="/#" data-path-hover="m 180,34.57627 -180,0 L 0,0 180,0 z">
							<figure>
								<img src={image} alt='five' />
								<svg viewBox="0 0 180 320" preserveAspectRatio="none"><path d="M 180,160 0,218 0,0 180,0 z" /></svg>
								<figcaption>
									<h2>Story</h2>
									<p>Lorem Ipsum is simply dummy text of the printing and typesetting industry.</p>
									<button>View</button>
								</figcaption>
							</figure>
						</a>

					</Slider>

					<button class="button" onClick={CatagoriesList}><span>Explore All </span></button>
				</section>
				
			</div>
		</div>
		
	)
	
}


export default Catagories
